import React from 'react'

interface IProps{

}
interface IState{
isloggIn:boolean;
}
class AuthUser extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
        this.state={
            isloggIn:false
        }

    }   
        
   
    
    render()
    {
        return(
<React.Fragment>
<section>
    <div className='container'>
        <div className='row'>
            <div className='col-md-6'>
                <h4>Welcome User</h4>
                <h4>Welcome guest</h4>
                <div className='card'>
                    <div className='card-body'>
                        <button className='btn btn-success btn-md'>Log In</button>
                        <button className='btn btn-success btn-md'>LogOut</button>
                        <h3>Welcome User</h3>
                        
                    </div>
                </div>
            </div>
        </div>
    </div>
</section>
    
</React.Fragment>
        )
    }
};
export default AuthUser;
